// DonorMap.jsx
import React, { useEffect, useRef, useState, useMemo } from "react";
import {
  GoogleMap,
  Marker,
  InfoWindow,
  Circle,
  useJsApiLoader
} from "@react-google-maps/api";

const containerStyle = {
  width: "100%",
  height: "400px"
};

const circleOptions = {
  strokeOpacity: 0.6,
  strokeWeight: 2,
  clickable: false,
  draggable: false,
  editable: false,
  visible: true,
  zIndex: 1
};

function DonorMap({ recipientLocation, donors = [], searchRadiusMiles = 25 }) {
  const mapRef = useRef(null);
  const [selectedDonor, setSelectedDonor] = useState(null);

  const hasUserLocation =
    recipientLocation &&
    typeof recipientLocation.latitude === "number" &&
    typeof recipientLocation.longitude === "number";

  // Provide a center even when not loaded to keep render stable
  const center = hasUserLocation
    ? { lat: recipientLocation.latitude, lng: recipientLocation.longitude }
    : { lat: 0, lng: 0 };

  const radiusMeters = Number(searchRadiusMiles) * 1609.34;
  const apiKey = process.env.REACT_APP_GOOGLE_MAPS_API_KEY || "AIzaSyDcG9acW8tmFGsxYTGrrvoKjdafi4sP_-k";

  // load the Google Maps JS API and wait for it before using window.google
  const { isLoaded, loadError } = useJsApiLoader({
    googleMapsApiKey: apiKey,
    // libraries: ["places"] // add if you need Places
  });

  // Build icon only after the API is loaded
  const userIcon = useMemo(() => {
    if (!isLoaded || !window.google) return undefined;
    return {
      url: "http://maps.google.com/mapfiles/ms/icons/blue-dot.png",
      scaledSize: new window.google.maps.Size(40, 40)
    };
  }, [isLoaded]);

  useEffect(() => {
    if (!isLoaded) return; // wait for maps api
    if (!hasUserLocation) return;
    if (!mapRef.current) return;

    const map = mapRef.current;
    const bounds = new window.google.maps.LatLngBounds();

    bounds.extend(new window.google.maps.LatLng(center.lat, center.lng));

    donors.forEach((d) => {
      const lat = d?.location?.latitude;
      const lng = d?.location?.longitude;
      if (typeof lat === "number" && typeof lng === "number") {
        bounds.extend(new window.google.maps.LatLng(lat, lng));
      }
    });

    try {
      map.fitBounds(bounds);
    } catch (e) {
      map.setCenter(center);
      map.setZoom(12);
    }
  }, [isLoaded, hasUserLocation, center, donors]);

  if (loadError) {
    // helpful runtime message instead of crashing
    return <div className="map-error">Map failed to load: {loadError.message}</div>;
  }

  // show nothing until API is ready or until we have a valid user location
  if (!isLoaded || !hasUserLocation) {
    return null;
  }

  return (
    <GoogleMap
      mapContainerStyle={containerStyle}
      center={center}
      zoom={12}
      onLoad={(mapInstance) => {
        mapRef.current = mapInstance;
      }}
    >
      {/* user marker + circle */}
      <Marker position={center} icon={userIcon} title="Your location" />

      <Circle
        center={center}
        radius={radiusMeters}
        options={{
          ...circleOptions,
          fillOpacity: 0.06,
          strokeColor: "#1976D2",
          fillColor: "#1976D2"
        }}
      />

      {/* donor markers */}
      {Array.isArray(donors) &&
        donors.map((donor) => {
          const lat = donor?.location?.latitude;
          const lng = donor?.location?.longitude;
          if (typeof lat !== "number" || typeof lng !== "number") return null;
          return (
            <Marker
              key={donor.id || donor.uid || donor.email}
              position={{ lat, lng }}
              onClick={() => setSelectedDonor(donor)}
            />
          );
        })}

      {selectedDonor && (
        <InfoWindow
          position={{
            lat: selectedDonor.location.latitude,
            lng: selectedDonor.location.longitude
          }}
          onCloseClick={() => setSelectedDonor(null)}
        >
          <div>
            <h3>{selectedDonor.name || selectedDonor.fullname || "Donor"}</h3>
            <p>Blood Group: {selectedDonor.bloodGroup || selectedDonor.bloodType}</p>
            <p>Contact: {selectedDonor.contact || selectedDonor.phoneNo}</p>
          </div>
        </InfoWindow>
      )}
    </GoogleMap>
  );
}

export default DonorMap;
